import React from "react";
import Card from "../UI/Card";
import styles from './AddUser.module.css'



const AddUser = () => {
  
  return (
    <Card className={styles.input}>
      <form >
     <label htmlFor="">UserName</label>
     <input type="text" />
     <label htmlFor="">Age(Years)</label>
     <input type="number" />
      </form>
    </Card>
  );
};

export default AddUser;
